import React from 'react';
import {
    Container,
    Carousel,
} from 'reactstrap'
import {RecruiterCard} from './componentIndex';
import axios from 'axios';

class Team extends React.Component{

    render() {

        let resp_data = []

        const fetch_recruiters = async (event) => {
            //event.preventDefault();

          const resp = await axios.get(`http://192.168.56.101:1337/recruiters`);

          set_data(resp.data);
          //console.log(resp.data);
        }

        function set_data(data){resp_data = data}


        return(
            <div id= 'recruiting-team'  >
                {/* <Container> */}
                {resp_data.map(profile => <RecruiterCard key={profile.id} {...profile} />)}
                {/* </Container> */}

            </div>
        );
    }

}

export default Team;
